script: |
  super -f text -I q5632.spq | sort > q5632.out

inputs:
  - name: q5632.spq
    data: |
      SELECT col2 * col0 + - col0 * + - col2, col2 * - + col1 - - col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 + 6 NOT IN ( 64 * + col1 );
  - name: tab1

outputs:
  - name: q5632.out
    data: |
      10030	-210
      12376	-3105
      9792	-1293
